bio-en:
Dr. Angela Arlen completed her residency in urology at the [University of Iowa](https://medicine.uiowa.edu) and her pediatric urology fellowship at [Emory University](http://med.emory.edu/) / [Children’s Healthcare of Atlanta](https://www.choa.org) in 2014, and joined the Department of Urology as an Assistant Professor in 2017.
{: .lead}

Dr. Arlen’s research interests include hypospadias and vesicoureteral reflux clinical outcomes.

Dr. Mohan S. Gundeti is an internationally recognized leader in the field of pediatric robotic and laparoscopic surgery for treatment of congenital urological anomalies. Dr. Gundeti is frequently recognized for his excellence in surgical teaching and instruction to medical students, residents, fellows and surgical colleagues. He frequently serves as a guest speaker and faculty member for symposia and live surgery workshops for more than 25 countries.
{: .lead}

Dr. Gundeti's research focuses on patient outcomes and innovative techniques in minimally invasive surgery.

Amrita is a fourth year medical student at the University of Chicago Pritzker School of Medicine. Shehas worked on various urology research projects and published with Dr. Mohan Gundeti.
{: .lead}

She is very interested in a urology residency and is seeking a position during the 2021 interview season.
